import { useState, useEffect } from "react";
import autologo from "./assets/myauto.png";

import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Manufacturer } from "./domain/manufacturer";
import { Cat } from "./domain/cat";
import { Product } from "./domain/product";
import { Model } from "./domain/model";

import {
  Button,
  ButtonGroup,
  Dropdown,
  InputGroup,
  FormControl,
} from "react-bootstrap";

const api1 = "https://static.my.ge/myauto/js/mans.json";
const api2 = "https://api2.myauto.ge/ka/getManModels?man_id=10";
const api3 = "https://api2.myauto.ge/ka/cats/get";
const api4 = "https://api2.myauto.ge/ka/products/";

function App() {
  const [manufacturers, setmanufacturers] = useState<Manufacturer[]>([]);
  const [models, setmodels] = useState<Model[]>([]);
  const [cat_lst, setcat_lst] = useState<Cat[]>([]);
  const [product_lst, setproduct_lst] = useState<Product[]>([]);
  const [loading, setloading] = useState(true);
  const [currency, setCurrency] = useState<string>("$");

  const handleCurrencyChange = () => {
    setCurrency(currency === "$" ? "â‚¬" : "$");
  };
  const fetchManufacturers = async () => {
    try {
      const response = await fetch(api1);
      const data = await response.json();
      setmanufacturers(data);
      console.log(data);
    } catch (error) {
      console.error(error);
    }
  };

  const fetchModels = async () => {
    try {
      const response = await fetch(api2);
      const data = await response.json();

      setmodels(data.data);
    } catch (error) {
      console.error(error);
    }
  };

  const fetchCatList = async () => {
    try {
      const response = await fetch(api3);
      const data = await response.json();

      setcat_lst(data.data);
    } catch (error) {
      console.error(error);
    }
  };

  const fetchProductList = async () => {
    try {
      const response = await fetch(api4);
      const data = await response.json();

      setproduct_lst(data.data.items);
    } catch (error) {
      console.error(error);
    }
  };

  useEffect(() => {
    fetchManufacturers();
    fetchModels();
    fetchCatList();
    fetchProductList();
    // const M = new Manufacturer(1314, "ye", 13, 14, 15);
    // M.barks();
  }, []);

  useEffect(() => {
    setloading(false);
  }, [manufacturers, models, cat_lst, product_lst]);

  const cat = <div>loaded</div>;

  type RadioType = {
    id: string;
    name: string;
    value: string;
  };

  const radios: RadioType[] = [
    { id: "radio1", name: "Radio 1", value: "radio1" },
    { id: "radio2", name: "Radio 2", value: "radio2" },
    { id: "radio3", name: "Radio 3", value: "radio3" },
  ];
  // console.log(product_lst[0]);
  // console.log(product_lst[0]?.bark());
  return (
    <div>
      <header className="bg-light">
        <nav className="navbar navbar-expand-lg navbar-light">
          <div className="container">
            <a className="navbar-brand" href="#">
              <img src={autologo} alt="myauto" className="header-logo" />
            </a>
          </div>
        </nav>
      </header>
      {loading ? <div>loading</div> : cat}

      <div
        style={{
          width: "320px",
          height: "660px",
          backgroundColor: "rgb(255, 155, 155)",
        }}
      >
        <ButtonGroup style={{ width: "100%", height: "90px" }}>
          <Button variant="outline-primary">Cars</Button>
          <Button variant="outline-primary">Trucks</Button>
          <Button variant="outline-primary">Motorcycles</Button>
        </ButtonGroup>

        <div style={{ height: "350px" }}>
          <Dropdown>
            <Dropdown.Toggle variant="success" id="dropdown-basic">
              Selling Type
            </Dropdown.Toggle>
            <Dropdown.Menu>
              <Dropdown.Item href="#/action-1">Value 1</Dropdown.Item>
              <Dropdown.Item href="#/action-2">Value 2</Dropdown.Item>
              <Dropdown.Item href="#/action-3">Value 3</Dropdown.Item>
            </Dropdown.Menu>
          </Dropdown>

          <Dropdown>
            <Dropdown.Toggle variant="success" id="dropdown-basic">
              Manufacturer
            </Dropdown.Toggle>
            <Dropdown.Menu>
              <Dropdown.Item href="#/action-1">Value 1</Dropdown.Item>
              <Dropdown.Item href="#/action-2">Value 2</Dropdown.Item>
              <Dropdown.Item href="#/action-3">Value 3</Dropdown.Item>
            </Dropdown.Menu>
          </Dropdown>

          <Dropdown>
            <Dropdown.Toggle variant="success" id="dropdown-basic">
              Category
            </Dropdown.Toggle>
            <Dropdown.Menu>
              <Dropdown.Item href="#/action-1">Value 1</Dropdown.Item>
              <Dropdown.Item href="#/action-2">Value 2</Dropdown.Item>
              <Dropdown.Item href="#/action-3">Value 3</Dropdown.Item>
            </Dropdown.Menu>
          </Dropdown>
        </div>

        <div>
          <span>Price</span>
          <Button onClick={handleCurrencyChange} style={{ float: "right" }}>
            {currency}
          </Button>
          <InputGroup className="mb-3">
            <FormControl placeholder="From" />
            <FormControl placeholder="Max" />
          </InputGroup>
        </div>

        <InputGroup className="mb-3">
          <FormControl placeholder="Search" />
          <InputGroup.Text id="inputGroup-sizing-default">
            197963
          </InputGroup.Text>
        </InputGroup>
      </div>
    </div>
  );
}

export default App;
